                    "Description": "<u><link=\"Character:Anu\">Anu</link></u> and <u><link=\"Character:Tathamet\">Tathamet</link></u> destroy each other, creating Heaven/Hell and causing the <u><link=\"WorldFact:The Great Conflict\">Great Conflict</link></u> (also known as the Eternal Conflict).",
