                    "Description": "<u><link=\"Character:Tyrael\">Tyrael</link></u> explains that it was stolen to create <u><link=\"WorldFact:Sanctuary\">Sanctuary</link></u>, and <u><link=\"MapLocation:High Heavens\">Heaven</link></u>/<u><link=\"MapLocation:Burning Hells\">Hell</link></u> have fought to control it; It was held in <u><link=\"MapLocation:Pandemonium Fortress\">Pandemonium Fortress</link></u> and is what's battled over",
